import { useState } from "react";
import { useNavigate } from "react-router";
import styled from "styled-components";
import ReactMarkdown from "react-markdown";
import { Button, Error, FormField, Input, Label, Textarea } from "../styles";
import NavBar from "../components/NavBar";

function NewNote({ user }) {
  const [title, setTitle] = useState("");
  const [content, setContent] = useState("");
  const [errors, setErrors] = useState([]);
  const [isLoading, setIsLoading] = useState(false);
  const navigate = useNavigate();

  function handleSubmit(e) {
    e.preventDefault();
    setIsLoading(true);
    fetch("/notes", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify({
        title,
        content
      }),
    }).then((r) => {
      setIsLoading(false);
      if (r.ok) {
        navigate("/");
      } else {
        r.json().then((err) => setErrors(err.errors));
      }
    });
  }

  return (
    <div className="flex min-h-screen  2xl:max-w-screen-2xl 2xl:mx-auto 2xl:border-x-2 2xl:border-gray-200 dark:2xl:border-zinc-700">
    <aside className=" w-1/6 py-10 pl-10  min-w-min  border-r border-gray-300 dark:border-zinc-700  hidden md:block ">
        <NavBar />
    </aside>

    <main class="flex-1 py-10  px-5 sm:px-10">
        <div class="max-w-2xl mx-auto bg-white p-10">
         <Wrapper>
       <WrapperChild>
         <h2>Create Note</h2>
         <form onSubmit={handleSubmit}>
           <FormField>
             <Label htmlFor="title">Title</Label>
             <Input
               type="text"
               id="title"
               value={title}
               onChange={(e) => setTitle(e.target.value)}
               placeholder="Note Title"
             />
           </FormField>
           <FormField>
             <Label htmlFor="content">Content</Label>
             <Textarea
               id="content"
               rows="10"
               value={content}
               onChange={(e) => setContent(e.target.value)}
             />
           </FormField>
           <FormField>
             <Button color="primary" type="submit">
               {isLoading ? "Loading..." : "Submit Note"}
             </Button>
           </FormField>
           <FormField>
             {errors.map((err) => (
               <Error key={err}>{err}</Error>
             ))}
           </FormField>
         </form>
       </WrapperChild>
     </Wrapper>
